import React from "react";
import Room from "./Room";

export default function RoomsList({rooms}){
   if(rooms.length === 0)
   {
       return (
           <div>
               <h3>Unfortunately no rooms matched your serch pattern</h3>
           </div>
       )
   } 
    return (
        <div>
            hello from room list
        </div>
    )
}
